const BusDetails=[
  {
    id:"multiCollapse1",
    classN:"row  mt-5",
    type:"text",
    for:"companyname",
    labelC:"col-2",
    name:"Company Name:",
    inputC:"form-control col-3",
    placeholder:"Company Name"
  },
  {
    id:"multiCollapse1",
    classN:"row  mt-5",
    type:"text",
    for:"name",
    labelC:"col-2",
    name:"Business owner:",
    inputC:"form-control col-3",
    placeholder:"Business owner"
  },
  {
    id:"multiCollapse1",
    classN:"row  mt-5",
    type:"tel",
    for:"contact_num",
    labelC:"col-2",
    name:"Contact number:",
    inputC:"form-control col-3",
  },
  {
    id:"multiCollapse1",
    classN:"row mt-5",
    type:"email",
    for:"email",
    labelC:"col-2",
    name:"E-mail:",
    inputC:"form-control col-3",
    placeholder:"Enter your Email"
  },
  {
    id:"multiCollapse1",
    classN:"row mt-5",
    type:"tel",
    for:"phone",
    labelC:"col-2",
    name:"Phone Number:",
    inputC:"form-control col-3",
    placeholder:"Enter your Phone Number",
  },
  {
    id:"multiCollapse1",
    classN:"row  mt-5",
    type:"text",
    for:"city",
    labelC:"col-2",
    name:"City:",
    inputC:"form-control col-3",
    placeholder:"City"
  },
  {
    id:"multiCollapse1",
    classN:"row  mt-5",
    type:"text",
    for:"street",
    labelC:"col-2",
    name:"Street:",
    inputC:"form-control col-3",
    placeholder:"street"
  },
  {
    id:"multiCollapse1",
    classN:"row  mt-5",
    type:"text",
    for:"zip",
    labelC:"col-2",
    name:"Zip Code:",
    inputC:"form-control col-3",
    placeholder:"Zip code"
  },

]
export default BusDetails
